Syntheses

 1: [Cu2(H2L22)(OH)(H2O)(NO3)](NO3)3⋅2H2O

A methanolic solution (5 mL) of N-(2-aminoethyl)piperazine (0.258 g, 2 mmol) was added dropwise to a heated methanolic solution (10 mL) of 4-methyl-2,6-diformylphenol (0.164 g, 1 mmol), and the resulting mixture was boiled for half an hour. Then, a methanolic solution (15 mL) of Cu(NO3)2⋅3H2O (0.604 g, 2.5mmol) was added and the resulting mixture refluxed for two hours. After cooling, the clear deep-green solution was kept in a CaCl2 desiccator in dark, and square-shaped deep-green crystals, suitable for X-ray data collection, were obtained after a few days. (Yield 70%). Anal. Calcd for C21H42N10O17Cu2 (1): C, 30.25; H, 5.08; N, 16.80; Cu, 15.24. Found: C, 30.29; H, 5.11; N, 16.84; Cu, 15.27%;

